#!/bin/bash
# Local bot deployment script
# Run this script from your local machine to deploy bot to Pi Zero on local network

set -e

# Get script directory and project root
SCRIPT_DIR="$(cd "$(dirname "${BASH_SOURCE[0]}")" && pwd)"
PROJECT_ROOT="$(cd "${SCRIPT_DIR}/.." && pwd)"
ENV_FILE="${PROJECT_ROOT}/bot/.env"

# Load configuration from bot/.env file
if [ -f "${ENV_FILE}" ]; then
    # Source the .env file to get PI_HOSTNAME and PI_USERNAME
    export $(grep -E '^PI_HOSTNAME=|^PI_USERNAME=' "${ENV_FILE}" | xargs)
fi

# Configuration (read from .env file, with fallback defaults)
PI_HOST="${PI_HOST:-${PI_HOSTNAME:-raspberrypi.local}}"
PI_USER="${PI_USER:-${PI_USERNAME:-pi}}"
BOT_PATH="${BOT_PATH:-~/bar-duel-championship/bot}"

# Colors for output
GREEN='\033[0;32m'
YELLOW='\033[1;33m'
RED='\033[0;31m'
NC='\033[0m' # No Color

echo -e "${GREEN}ü§ñ Bot Deployment Script${NC}"
echo "================================"
if [ -f "${ENV_FILE}" ]; then
    echo "Config: Loaded from ${ENV_FILE}"
else
    echo "Config: Using defaults (${ENV_FILE} not found)"
fi
echo "Target: ${PI_USER}@${PI_HOST}"
echo "Path: ${BOT_PATH}"
echo ""

# Check if restart-only flag is set
RESTART_ONLY=false
if [ "$1" == "--restart-only" ] || [ "$1" == "-r" ]; then
    RESTART_ONLY=true
    echo -e "${YELLOW}Mode: Restart only (skipping git pull)${NC}"
else
    echo -e "${GREEN}Mode: Full deployment (git pull + restart)${NC}"
fi
echo ""

# Pull latest code
if [ "$RESTART_ONLY" = false ]; then
    echo -e "${GREEN}üì• Pulling latest code...${NC}"
    ssh "${PI_USER}@${PI_HOST}" << EOF
        set -e
        cd ${BOT_PATH}
        echo "Current directory: \$(pwd)"
        echo "Current branch: \$(git branch --show-current)"
        git pull origin main
        echo "‚úÖ Code updated"
EOF
    echo ""
fi

# Restart bot
echo -e "${GREEN}üîÑ Restarting bot...${NC}"
ssh "${PI_USER}@${PI_HOST}" << EOF
    set -e
    cd ${BOT_PATH}
    
    # Try systemd service first
    if systemctl is-active --quiet bar-bot 2>/dev/null; then
        echo "Restarting systemd service: bar-bot"
        sudo systemctl restart bar-bot
        sleep 2
        systemctl status bar-bot --no-pager || true
    elif pgrep -f "python.*main.py" > /dev/null; then
        echo "Restarting bot process..."
        pkill -f "python.*main.py"
        sleep 2
        nohup python3 main.py > bot.log 2>&1 &
        echo "Bot restarted (PID: \$!)"
    else
        echo "No running bot found. Starting bot..."
        nohup python3 main.py > bot.log 2>&1 &
        echo "Bot started (PID: \$!)"
    fi
EOF
echo ""

# Verify bot is running
echo -e "${GREEN}‚úÖ Verifying bot status...${NC}"
ssh "${PI_USER}@${PI_HOST}" << EOF
    sleep 2
    if systemctl is-active --quiet bar-bot 2>/dev/null; then
        echo "‚úÖ Bot service is running (systemd)"
        systemctl status bar-bot --no-pager -l || true
    elif pgrep -f "python.*main.py" > /dev/null; then
        echo "‚úÖ Bot process is running"
        ps aux | grep "python.*main.py" | grep -v grep || true
    else
        echo -e "${RED}‚ö†Ô∏è  Warning: Bot process not found after restart${NC}"
        exit 1
    fi
EOF

# Show deployment version/timestamp
echo ""
echo -e "${GREEN}üìÖ Deployment Information:${NC}"
ssh "${PI_USER}@${PI_HOST}" << EOF
    cd ${BOT_PATH}
